import React from "react";

class nome extends React.Component {
  render() {
    return (
      <div>
        <h1>Beatriz Mediato</h1>
        <p>Tenho 21 anos e sou de Volta Redonda- RJ.</p>
        <h2>Minhas Habilidades</h2>
        <ul>
          <li>Unix e Bash</li>
          <li>JavaScript</li>
          <li>Html e CSS</li>
          <li>HOF</li>
          <li>FlexBox</li>
          <li>React</li>
        </ul>
      </div>
    )
  }
}

export default nome;
